import React from 'react';
import './Main.css';
import Header from './Header';
import JumboBanner from './JumboBanner';

const Main = () => {
  return (
    <div className="Main">
      <Header></Header>
      <JumboBanner></JumboBanner>
      <div className="TwoColumnGrid">
          <div>Photo</div>
          <div>Services Provided</div>
      </div>
      <div className="ThreeColumnGrid">
          <div>Photo</div>
          <div>Services Provided</div>
          <div>Photo</div>
      </div>
    </div>
  );
}

export default Main;
